DROP TABLE IF EXISTS student_info;

create table student_info (
	student_id VARCHAR(50) PRIMARY KEY,
	s_first_name VARCHAR(50) NOT NULL,
	s_last_name VARCHAR(50) NOT NULL,
	s_email VARCHAR(50) UNIQUE NOT NULL,
	s_gender VARCHAR(50) NOT NULL,
	s_qualification VARCHAR(20) NOT NULL,
	s_address VARCHAR(50) NOT NULL,
	s_country VARCHAR(50) NOT NULL,
	s_postalcode VARCHAR(50) NOT NULL
);
